import React from 'react';
import { GoogleLogin } from '@react-oauth/google';
import { GoogleOAuthProvider } from '@react-oauth/google';

const Login = () => {
    const responseMessage = (response) => {
        console.log(response);
    };
    const errorMessage = (error) => {
        console.log(error);
    };
    return (
        <GoogleOAuthProvider clientId="1010983540888-f1sblt8aj006tvabkas65plkmqjaditt.apps.googleusercontent.com">
            <GoogleLogin onSuccess={responseMessage} onError={errorMessage}
                icon={false}

                clientId="1010983540888-f1sblt8aj006tvabkas65plkmqjaditt.apps.googleusercontent.com"
                render={<button >This is my custom Google button</button>}
            />
        </GoogleOAuthProvider>


    )
}


export default Login;
